ready(()=>{var t=document.querySelectorAll("[data-lazybg]");if(t.length){let r=new IntersectionObserver((t,e)=>{t.forEach(t=>{t.isIntersecting&&((t=t.target).getAttribute("data-bg"),t.style.backgroundImage=t.getAttribute("data-bg"),t.removeAttribute("data-bg"),e.unobserve(t))})},{root:null,rootMargin:"0px",threshold:0});t.forEach(t=>{var e=t.getAttribute("data-lazybg");t.removeAttribute("data-lazybg"),t.setAttribute("data-bg",e),r.observe(t)})}});